script: |
  super -f text -I q10932.spq | sort > q10932.out

inputs:
  - name: q10932.spq
    data: |
      SELECT - col0 - cor0.col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN ( col2 ) AND NULL AND NOT NULL NOT BETWEEN ( col2 ) AND col0 * col2 OR NULL >= NULL;
  - name: tab1

outputs:
  - name: q10932.out
    data: |
